import logo from './logo.svg';
import './App.css';
import {Component} from 'react';

class App extends Component {
  constructor(){
    super();

    this.state={
      monsters:[
      {
        name: 'Linda'
      },
      {
        name: 'Frank'
      },
      {
        name: 'Jacky'
      }

    ]};

  }

  render(){
    return (
      <div className="App">
        <div className = "Monsters">
         {this.state.monsters.map(
          (monster) => {
            return <h1>{monster.name}</h1>
          }
         )

         }
        </div>

      </div>
    )
  }

}

export default App;
